import React, { useState, useEffect } from "react";
import CustomizedTables from "./Table";

export default function ContestDisplay(props) {
  const contestDetails = props.contestDetails;

  return (
    <React.Fragment>
      <h1>{contestDetails.name}</h1>

      <CustomizedTables />
    </React.Fragment>
  );
}
